import React from 'react';
import CarouselItem from './CarouselItem';
import classes from './carousel.module.scss';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { faAngleLeft, faAngleRight } from '@fortawesome/free-solid-svg-icons';
import { carousel } from './CarouselContent';
import ArrowRight from './ArrowRight';
import ArrowLeft from './ArrowLeft';

const Carousel = () => {
  return (
    <div className={classes.carousel}>
<ArrowLeft className={classes.arrowLeft}/>          <div className={classes.carouselWrapper}>
            {carousel.map(item => 
              <CarouselItem item={item} key={Math.random() + Date.now()}/>
              )}
        </div>
<ArrowRight className={classes.arrowRight}/>    </div>
  )
}

export default Carousel
